import './App.css';

function App() {

  const Person = (props) => {
    return(
      <>
        <h1>Name: {props.name}</h1>
        <h2>Last Name: </h2>
        <h2>Age: 30</h2>
      </>
    )
  }

  return (
    <div className="App">
     <Person />

    </div>
  );
}

export default App;
